import React, { Component } from 'react';
import './style.css'
class Header  extends Component {
    render() { 
    return (
    <>
        <div>
        <div className="logo">
            <h1>Its Logo</h1>
        </div>
        <div className="nav-menu">Menu 1</div>
        </div>
    </>
    );
    }
}
export default Header;
